CREATE DEFINER=`root`@`localhost` PROCEDURE `top_genre`(IN genre_name VARCHAR(50), IN count_books INT)
BEGIN
        SELECT b.title 
        FROM books b
            JOIN authors a ON a.id = b.author_id
            JOIN genre g ON (g.id = b.genre_id AND g.name = genre_name)
            JOIN rating_book rb ON rb.book_id = b.id 
        GROUP BY b.id 
        ORDER BY rb.book_id DESC
        LIMIT count_books;
    END ;;
DELIMITER ;
